import React, { Component } from 'react';
import './styleNavMenu.css';

class Menu extends Component {
    constructor(props){
        super(props);
        this.state = {
            isActive: false,
        }
    }
    render(){
        return (
            <div className='navMenu'>
                <li className='item'>
                    {this.props.name}
                </li>
             </div> 
        )
    }
}

export default Menu;
